-- Table Structure for Table : admin_student

DROP TABLE IF EXISTS admin_student;

CREATE TABLE `admin_student` (
  `student_id` int(11) NOT NULL AUTO_INCREMENT,
  `application_no` int(11) NOT NULL,
  `admission_id` int(11) NOT NULL,
  `schl_id` int(11) NOT NULL,
  `date` date NOT NULL,
  `academic_year` varchar(100) NOT NULL,
  `stream_id` int(11) NOT NULL,
  `class_id` int(11) NOT NULL,
  `division_id` int(11) NOT NULL,
  `student_name` varchar(300) NOT NULL,
  `status` int(11) NOT NULL COMMENT 'Active:1 Inactive:2 FeeUnpaid:3  InsidePromoted:4',
  `promoted_by` varchar(250) NOT NULL,
  `registered_by` varchar(200) NOT NULL,
  `registered_date` date NOT NULL,
  `registered_class` varchar(10) NOT NULL,
  `registered_academic_year` varchar(100) NOT NULL,
  `development_status` int(11) NOT NULL COMMENT 'Development Fees Paid:0, Unpaid:1',
  `admission_status` int(11) NOT NULL COMMENT 'New:1 ReAdmission:2',
  PRIMARY KEY (`student_id`)
) ENGINE=InnoDB AUTO_INCREMENT=1975 DEFAULT CHARSET=latin1;




